import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
import { title } from "assets/jss/material-kit-react.js";

// @material-ui/icons
import VerifiedUser from "@material-ui/icons/VerifiedUser";
import Fingerprint from "@material-ui/icons/Fingerprint";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import Button from "@material-ui/core/Button";
// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import InfoArea from "components/InfoArea/InfoArea.js";

import GettingStarted from "./../BlogExtract/GettinStarted.js"

const useStyles = makeStyles((theme) => ({
    btn: {
        marginBottom: 12,
        width: 'auto',
    },
    section: {
        padding: "70px 0",
        textAlign: "center"
    },
    title: {
        ...title,
        marginBottom: "1rem",
        marginTop: "30px",
        minHeight: "32px",
        textDecoration: "none"
    },
    description: {
        color: "#999"
    }
}));

export default function BlogExtractSection() {
    const classes = useStyles();
    return (
        <div className={classes.section}>
            <GridContainer justify="center">
                <GridItem xs={12} sm={12} md={8}>
                    <h2 className={classes.title}>Some information that might help you</h2>
                    <h5 className={classes.description}>
                        You can just click on either button "Technical Documentation" or "User Documentation" to filter you choice or to "All Documentation" to see all of it.
                    </h5>
                </GridItem>
                <GridItem>
                <ButtonGroup color="primary" aria-label="outlined primary button group" className={classes.btn}>
                    <Button>User Documentation</Button>
                    <Button>All</Button>
                    <Button>Technical Documentation</Button>
                </ButtonGroup>
                </GridItem>
            </GridContainer>
            <div>
                <GridContainer>
                    <GridItem xs={12} sm={12} md={4}>
                        <GettingStarted/>
                    </GridItem>
                    <GridItem xs={12} sm={12} md={4}>
                        <InfoArea
                            title="Verified Users"
                            description="Divide details about your product or agency work into parts. Write a few lines about each one. A paragraph describing a feature will be enough."
                            icon={VerifiedUser}
                            iconColor="success"
                            vertical
                        />
                    </GridItem>
                    <GridItem xs={12} sm={12} md={4}>
                        <InfoArea
                            title="Fingerprint"
                            description="Divide details about your product or agency work into parts. Write a few lines about each one. A paragraph describing a feature will be enough."
                            icon={Fingerprint}
                            iconColor="danger"
                            vertical
                        />
                    </GridItem>
                </GridContainer>
            </div>
        </div>
    );
}
